export const CHANGE_CURRENT_SORT_ATTRIBUTE = '[dataSet]CHANGE_CURRENT_SORT_ATTRIBUTE';
export const changeCurrentSortAttribute = sortAttribute => ({
    type: CHANGE_CURRENT_SORT_ATTRIBUTE,
    payload: sortAttribute,
});

export const CHANGE_PRODUCT_TYPE = '[dataSet]CHANGE_PRODUCT_TYPE';
export const changeProductType = productType => ({
    type: CHANGE_PRODUCT_TYPE,
    payload: productType,
});

export const CHANGE_PRODUCT_LINE = '[dataSet]CHANGE_PRODUCT_LINE';
export const changeProductLine = productLine => ({
    type: CHANGE_PRODUCT_LINE,
    payload: productLine,
});

export const SET_DISPLAY_DATA = '[dataSet]SET_DISPLAY_DATA';
export const setDisplayData = data => ({
    type: SET_DISPLAY_DATA,
    payload: data,
});
